import React from 'react';
import './feature.css';
import bgn from './bgn.png';
import jpr from './jpr.png';
import mbm from './mumbai.png';

export default function Feature(){

    return(
        <>
        <div className="features">
            <div className="featureItem">
                <img src={bgn}/>
            </div>
            <div className="featureItem">
                <img src={mbm}/>
            </div>
            <div className="featureItem">
                <img src={jpr}/>
            </div>
        </div>

        </>
    );
}
